import React from "react";
import "./Wrapper.css";

const Wrapper = props => <div className="wrapper">{props.children}
<div className ="music">
<iframe width="100%" height="300" scrolling="no" frameborder="no" allow="autoplay" src="https://w.soundcloud.com/player/?url=https%3A//api.soundcloud.com/tracks/218794798&color=%23ff5500&auto_play=true&hide_related=false&show_comments=true&show_user=true&show_reposts=false&show_teaser=true&visual=true"></iframe>
</div>

</div>;

export default Wrapper;
